public class Solution {
    private const int MOD = 1000000007;

    public int CountSubMultisets(IList<int> nums, int l, int r) {
        long[] dp = new long[20001];
        dp[0] = 1;
        foreach (int num in nums) {
            for (int i = 20000; i >= num; i--) {
                dp[i] = (dp[i] + dp[i - num]) % MOD;
            }
        }

        long result = 0;
        for (int i = l; i <= r; i++) {
            result = (result + dp[i]) % MOD;
        }

        // Subtract the count of subsets with sum < l to get the correct count
        for (int i = 0; i < l; i++) {
            result = (MOD + result - dp[i]) % MOD;
        }

        return (int)result;
    }
}
